g.desc:
{
"connections":{
"TRND":"$T",
"disable_by":"",
"hide_by":"",
"reset_by":""
},
"metaData":{
"bufferSize":{
"desc":"The size of the buffer in the client web browser. If <code>-1</code> the target TRND block buffer size is used.<br /><i>Note: if the buffer is larger than the buffer on the device the history is lost when the page is refreshed.</i><br /><i>Note: Large buffer can slow your device especially on slower CPUs like RaspberryPi</i>",
"order":"03",
"type":"number"
},
"connections":{
"TRND":{
"desc":"Set the datapoint to any parameter of the TRND block eg. <code>taskname.TRND:u1</code> to enable reading of all signals.",
"order":"01"
},
"disable_by":{
"desc":"If non-zero the component is disabled and data are no longer updated.",
"optional":true
},
"hide_by":{
"desc":"If non-zero the component is hidden.",
"optional":true
},
"reset_by":{
"desc":"If non-zero the data from trend are deleted.",
"optional":true,
"order":"02"
}
},
"desc":"The TRND component is used for displaying the signals from the TRND blocks. Simply just set <code>TRND</code> datapoint to any parameter of the TRND block eg. <code>taskname.TRND:u1</code>. All signals will be displayed in the trend. Each signal can be labeled using <code>signals</code> table.",
"dygraphOptions":{
"desc":"Custom options for Dygraph library. See http://dygraphs.com/options.html for more info.",
"order":"06",
"type":"object"
},
"hideLegend":{
"desc":"Hide the legend of the graph.",
"order":"05",
"type":"bool"
},
"refreshRate":{
"desc":"Custom refresh rate of the trend. Normally the trend is refreshed with the HMI main refresh rate period. If needed each trend can have custom one.",
"min":50,
"order":"04",
"type":"number"
},
"signals":{
"columns":{
"label":{
"order":"01",
"type":"str"
}
},
"desc":"Table of signal labels. Write labels in the same order as you connect the signals to the TRND block.",
"order":"02",
"type":"table"
},
"title":{
"desc":"Trend title",
"order":"01",
"type":"str"
}
},
"options":{
"bufferSize":600,
"dygraphOptions":{},
"hideLegend":"False",
"refreshRate":-1,
"signals":[
{
"label":"Analog"
},
{
"label":"Sine wave"
},
{
"label":"Binary"
},
{
"label":"Ramp, step"
}
],
"title":"Trend in HMI"
}
}

{
"HTMLexport":{
"ExcludeDefaultLibraries":false,
"ExpertMode":false,
"Header":"Signal generator demo",
"Libs":[],
"Target":"hmi\\index.html",
"Template":"",
"Title":"Signal generator demo",
"Tooltips":true,
"ViewBox":true,
"checkedVersion":"10442"
},
"UserData":{},
"connections":[
{
"alias":"SVG-TRND",
"cstring":"myproject_task.TRND:u1",
"type":"R"
}
],
"metaData":{
"desc":"Global RexHMI configuration component. User can change project options, configure the HTML export and define list of connections between REXYGEN target and HMI.",
"header_mode":{
"desc":"Change the default size of the header (thin, packed). If packed click on the logo to show the header.",
"order":"05",
"type":"enum",
"values":[
"",
"thin",
"pack-top-left",
"pack-top-right",
"pack-bottom-left",
"pack-bottom-right"
]
},
"kiosk_mode":{
"desc":"If True the links from header (from logo and header) are removed and user can not change the refresh rate and target.",
"order":"06",
"type":"bool"
},
"log_level":{
"desc":"Set the global log level for whole RexHMI. The log messages are written both to the right upper corner menu and to the web browser console. Default level is INFO.",
"order":"02",
"type":"enum",
"values":[
"",
"TRACE",
"DEBUG",
"INFO",
"WARN",
"ERROR"
]
},
"refresh_rate":{
"desc":"Changes the default read refresh rate of the whole HMI. Default 500ms",
"max":"300000",
"min":"20",
"order":"01",
"type":"int"
},
"show_clock":{
"desc":"If True the clock are shown in the right upper corner of the template instead of blinking square. If the target is connected the clock are updated if connection get error o lost the time stops.",
"order":"03",
"type":"bool"
},
"target_url":{
"desc":"The URL of the target device. So far only the WebSocket protocol is supported. The URL must also contain the PORT, but the protocol can be omitted. Default is empty string which means ws://127.0.0.1:8008 <br /> Examples: 192.168.1.100:8008 or wss://192.168.1.100:8009 <br /> <i> Note: If the HMI is hosted on the internal web server this option is ignored and HMI connects to the hostname / IP you use in the webbrowser URL.</i>",
"order":"07",
"prev":[
"ws_ip"
],
"type":"str"
},
"use_client_time":{
"desc":"If True the <code>show_clock</code> display the time from client computer rather then target. This can be use when target device does not have NTP synchronization or RTC chip.",
"order":"04",
"type":"bool"
}
},
"options":{
"header_mode":"",
"kiosk_mode":"False",
"log_level":"",
"refresh_rate":"",
"show_clock":"False",
"target_url":"",
"use_client_time":"False"
}
}
